import { ENV } from './env';

export interface OnlyOfficeConfig {
  document: {
    fileType: string;
    key: string;
    title: string;
    url: string;
  };
  documentType: string;
  editorConfig: {
    mode: string;
    lang: string;
    customization: {
      autosave: boolean;
      forcesave: boolean;
      compactToolbar: boolean;
      feedback: boolean;
      help: boolean;
      hideRightMenu: boolean;
      toolbarNoTabs: boolean;
      zoom: number;
    };
    user: {
      id: string;
      name: string;
    };
  };
  width: string;
  height: string;
  type: string;
}

